**Step 1: Key Psychological Mechanisms**

The responder's decision likely hinges on perceived fairness and self-interest.  Fairness could be judged relative to the combined earnings and the opponent's contribution (token_opp and combined_earning) considering their relative effort, as well as the proposed split (split_self). Self-interest is straightforward – the higher the offered amount (split_self), the more attractive the acceptance.

**Step 2: Interaction of Mechanisms**

The model needs to balance fairness and self-interest. A responder might accept an unfair offer if the self-gain is sufficiently high, but the weight given to fairness versus self-interest will vary between individuals.  The pre-task token count (token_self) could also reflect the responder's perceived entitlement, influencing their fairness threshold.

**Step 3: Mathematical Form**

A suitable form is a weighted linear combination of fairness and self-interest terms, passed through a logistic function to produce a probability of acceptance.  This allows for a continuous utility representation that maps directly to a binary decision.

**Step 4: Parameters**

We need parameters to weight the relative importance of fairness and self-interest, and possibly to account for individual differences in sensitivity to these factors.  The parameters also need to incorporate the pre-task token count (token_self) as an individual difference measure.

**Step 5: Mapping to Observable Behavior**

